    #[doc = " The CPU's write-gather pipe is used to write data to the FIFO. Therefore, the FIFO memory area must be forced out of the CPU"]
    #[doc = " cache prior to being used. DCInvalidateRange() may be used for this purpose. Due to the mechanics of flushing the write-gather"]
    #[doc = " pipe, the FIFO memory area should be at least 32 bytes larger than the maximum expected amount of data stored. Up to 32 NOPs"]
    #[doc = " may be written at the end during flushing."]
    #[doc = ""]
    #[doc = " \\note GX_Init() also takes the arguments \\a base and \\a size and initializes a FIFO using these values and attaches the FIFO"]
    #[doc = " to both the CPU and GP. The application must allocate the memory for the graphics FIFO before calling GX_Init(). Therefore, it"]
    #[doc = " is not necessary to call this function unless you want to resize the default FIFO sometime after GX_Init() has been called or"]
    #[doc = " you are creating a new FIFO. The minimum size is 64kB defined by <tt>GX_FIFO_MINSIZE</tt>.<br><br>"]
    #[doc = ""]
    #[doc = " \\note This function will also set the read and write pointers for the FIFO to the base address, so ordinarily it is not"]
    #[doc = " necessary to call GX_InitFifoPtrs() when initializing the FIFO. In addition, This function sets the FIFO's high water mark to"]
    #[doc = " (size-16kB) and the low water mark to (size/2), so it is also not necessary to call GX_InitFifoLimits()."]
    #[doc = ""]
    #[doc = " \\param[in] fifo the fifo struct to use"]
    #[doc = " \\param[in] base ptr to the base of allocation; must be 32-byte aligned"]
    #[doc = " \\param[in] size size of the FIFO in bytes; must be multiple of 32; size must be <tt>GX_FIFO_MINSIZE</tt> or larger"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_InitFifoBase(fifo: *mut GXFifoObj, base: *mut ::libc::c_void, size: u32_);
