    #[doc = " \\brief Sets the high and low water mark for the \\a fifo."]
    #[doc = ""]
    #[doc = " \\details The high and low water marks are used in <i>immediate-mode</i>, i.e. when the \\a fifo is attached to both the CPU and"]
    #[doc = " Graphics Processor (GP) (see GX_SetCPUFifo() and GX_SetGPFifo())."]
