    #[doc = " The hardware keeps track of the number of bytes between the read and write pointers. This number represents how full the FIFO is,"]
    #[doc = " and when it is greater than or equal to the \\a hiwatermark, the hardware issues an interrupt. The GX API will suspend sending"]
    #[doc = " graphics to the Graphics FIFO until it has emptied to a certain point. The \\a lowatermark is used to set the point at which the"]
    #[doc = " FIFO is empty enough to resume sending graphics commands to the  FIFO. Both \\a hiwatermark and \\a lowatermark should be in"]
    #[doc = " multiples of 32B. The count for \\a lowatermark should be less than \\a hiwatermark. Of course, \\a hiwatermark and \\a lowatermark"]
    #[doc = " must be less than the size of the FIFO."]
    #[doc = ""]
