    #[doc = " \\brief Attaches \\a fifo to the GP."]
    #[doc = ""]
    #[doc = " \\note If the FIFO is also attached to the CPU, the system is in immediate-mode, and the fifo acts like a true FIFO. In immediate-mode,"]
    #[doc = " graphics commands are fed directly from the CPU to the GP. In immediate-mode the FIFO's high and low water marks are active. The high"]
    #[doc = " and low water marks implement the flow-control mechanism between the CPU and GP. When the FIFO becomes more full than the high water"]
    #[doc = " mark, the CPU will stop writing graphics commands into the FIFO.  When the FIFO empties to a point lower than the low water mark, the"]
    #[doc = " CPU will resume writing graphics commands into the FIFO. The high and low water marks are set when intializing the FIFO using"]
    #[doc = " GX_InitFifoLimits().<br><br>"]
