    #[doc = " \\note If the FIFO is only attached to the GP, the FIFO acts like a buffer. In this case, high and low water marks are disabled, and"]
    #[doc = " the GP reads the FIFO until it is empty. Before attaching a new FIFO to the GP, you should make sure the previous FIFO is empty, using"]
    #[doc = " the \\a cmdIdle status returned by GX_GetGPStatus().<br><br>"]
    #[doc = ""]
    #[doc = " \\note The break point mechanism can be used to force the FIFO to stop reading commands at a certain point; see GX_EnableBreakPt()."]
    #[doc = ""]
