    #[doc = ""]
    #[doc = " \\note The break point feature allows the application to have two frames of graphics in the FIFO at the same time, overlapping"]
    #[doc = " one frame's processing by the graphics processor with another frame's processing by the CPU. For example, suppose you finish"]
    #[doc = " writing the graphics commands for one frame and are ready to start on the next. First, execute a GX_Flush() command to make"]
    #[doc = " sure all the data in the CPU write gatherer is flushed into the FIFO. This will also align the FIFO write pointer to a 32B"]
    #[doc = " boundary. Next, read the value of the current write pointer using GX_GetFifoPtrs(). Write the value of the write pointer as"]
    #[doc = " the break point address using GX_EnableBreakPt(). When the FIFO read pointer reaches the break point address the hardware"]
    #[doc = " will disable reads from the FIFO.  The status \\a brkpt, returned by GX_GetGPStatus(), can be polled to detect when the break point"]
    #[doc = " is reached. The application can then decide when to disable the break point, using GX_DisableBreakPt(), which will allow the FIFO"]
    #[doc = " to resume reading graphics commands.<br><br>"]
    #[doc = ""]
    #[doc = " \\note FIFO reads will stall when the GP FIFO read pointer is equal to the break point address \\a break_pt. To re-enable reads of"]
    #[doc = " the GP FIFO, use GX_DisableBreakPt().<br><br>"]
