extern "C" {
    #[doc = " \\fn void GX_SetArray(u32 attr,void *ptr,u8 stride)"]
    #[doc = " \\brief Sets the array base pointer and stride for a single attribute."]
    #[doc = ""]
    #[doc = " \\details The array base and stride are used to compute the address of indexed attribute data using the equation:<br><br>"]
    #[doc = ""]
    #[doc = " &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<i>attr_addr</i> = \\a ptr + <i>attr_idx</i> * \\a stride"]
    #[doc = ""]
    #[doc = " When drawing a graphics primitive that has been enabled to use indexed attributes (see GX_SetVtxDesc()), <i>attr_idx</i> is supplied in the vertex"]
    #[doc = " data. The format and size of the data in the array must also be described using GX_SetVtxAttrFmt(). You can also index other data, such as"]
    #[doc = " matrices (see GX_LoadPosMtxIdx(), GX_LoadNrmMtxIdx3x3(), and GX_LoadTexMtxIdx()), and light objects (see GX_LoadLightObjIdx()). In the case"]
    #[doc = " of matrices and light objects, the size and format of the data to be loaded is implied by the function call."]
    #[doc = ""]
    #[doc = " There is a base pointer, \\a ptr, for each type of attribute as well as for light data and matrices. Each attribute can be stored in its own"]
    #[doc = " array for maximum data compression (i.e., removal of redundant attribute data). The \\a stride is in byte units and is the distance between"]
    #[doc = " attributes in the array."]
    #[doc = ""]
    #[doc = " \\note Indexed data is loaded into a vertex cache in the graphics processor. The vertex cache fetches 32B of data for each cache miss;"]
    #[doc = " therefore, there is a small performance benefit to aligning attribute arrays to 32B, and possibly for arranging vertex data so that it"]
    #[doc = " doesn't span 32B boundaries. Conveniently enough, memalign() returns 32-byte aligned pointers. For static data arrays, you can use the"]
    #[doc = " ATTRIBUTE_ALIGN(32) attribute macro to align the \\a ptr to 32B."]
    #[doc = ""]
    #[doc = " \\param[in] attr \\ref vtxattr that the array is storing"]
    #[doc = " \\param[in] ptr pointer to the array itself"]
    #[doc = " \\param[in] stride stride (in bytes) between each element in the array"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_SetArray(attr: u32_, ptr: *mut ::libc::c_void, stride: u8_);
}
extern "C" {
    #[doc = " \\fn void GX_SetVtxAttrFmt(u8 vtxfmt,u32 vtxattr,u32 comptype,u32 compsize,u32 frac)"]
    #[doc = " \\brief Sets the attribute format (\\a vtxattr) for a single attribute in the Vertex Attribute Table (VAT)."]
    #[doc = ""]
    #[doc = " \\details Each attribute format describes the data type (comptype), number of elements (compsize), and fixed point format (frac), if required. The"]
    #[doc = " are eight vertex formats available in the VAT. The vertex format describes the format of all attributes in a vertex. The application can pre-program"]
    #[doc = " all eight vertex formats and then select one of them during the actual drawing of geometry (See GX_Begin()). Note that all vertices used to draw a"]
    #[doc = " particular graphics primitive will have the same format. The vertex format set using this function, along with the current vertex descriptor set"]
    #[doc = " using GX_SetVtxDesc(), completely define the vertex data format."]
    #[doc = ""]
    #[doc = " \\note The vertex format allows data to be sent to the graphics processor in its most <i>quantized</i> format. The graphics hardware will <i>inverse-quantize</i>"]
    #[doc = " the data (into floating point format) before it is used. The vertex attribute format is used to communicate the data quantization format to the hardware.<br><br>"]
    #[doc = ""]
    #[doc = " \\note <tt>GX_VA_NRM</tt> and <tt>GX_VA_NBT</tt> attributes share the same type. Also, the frac for these attributes is fixed according to the type. The component count"]
    #[doc = " (compsize) for <tt>GX_VA_NRM</tt> must be set to <tt>GX_NRM_XYZ</tt>. The component count for <tt>GX_VA_NBT</tt> must be set to <tt>GX_NRM_NBT</tt> or <tt>GX_NRM_NBT3</tt>."]
    #[doc = ""]
    #[doc = " \\param[in] vtxfmt \\ref vtxfmt"]
    #[doc = " \\param[in] vtxattr \\ref vtxattr"]
    #[doc = " \\param[in] comptype \\ref comptype"]
    #[doc = " \\param[in] compsize \\ref compsize"]
    #[doc = " \\param[in] frac number of fractional bits in a fixed-point number"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_SetVtxAttrFmt(vtxfmt: u8_, vtxattr: u32_, comptype: u32_, compsize: u32_, frac: u32_);
}
