extern "C" {
    #[doc = " \\fn u32 GX_EndDispList(void)"]
    #[doc = " \\brief Ends a display list and resumes writing graphics commands to the CPU FIFO."]
    #[doc = ""]
    #[doc = " \\details This function returns the size of the display list written to the display list buffer since GX_BeginDispList() was called. If"]
    #[doc = " the display list size exceeds the size of the buffer allocated, a zero length size will be returned. The display list size is a"]
    #[doc = " multiple of 32B and any unsed commands in the last 32B will be padded with <tt>GX_NOP</tt>. The size returned should be passed to"]
    #[doc = " GX_CallDispList() when the display list needs to be executed."]
    #[doc = ""]
    #[doc = " \\note Due to the mechanics of flushing the write-gather pipe (which is used to create the display list), the display buffer should be"]
    #[doc = " at least 32 bytes larger than the maximum expected amount of data stored. This function calls GX_Flush(), and thus it is not necessary"]
    #[doc = " to call GX_Flush() explicitly after creating the display list.<br><br>"]
    #[doc = ""]
    #[doc = " \\note A display list cannot be nested; i.e., no display list functions (GX_BeginDispList(), GX_EndDispList() and GX_CallDispList()) can"]
    #[doc = " be called between a GX_BeginDispList() and GX_EndDispList() pair.<br><br>"]
    #[doc = ""]
    #[doc = " \\note To execute a display list, use GX_CallDispList()."]
    #[doc = ""]
    #[doc = " \\return 0 if display list size exceeds buffer, otherwise gives list size in bytes"]
    #[doc = ""]
    #[doc = " \\bug Specifying a display list buffer size for GX_BeginDispList() the exact size that the display list will be (after padding) will cause"]
    #[doc = " this function to return a very large (and very incorrect) value."]
    pub fn GX_EndDispList() -> u32_;
}
