extern "C" {
    #[doc = " \\fn void GX_BeginDispList(void *list,u32 size)"]
    #[doc = " \\brief Begins a display list and disables writes to the FIFO currently attached to the CPU."]
    #[doc = ""]
    #[doc = " \\details After this function is called, GX API functions that normally send command or data into the CPU FIFO will send them to the"]
    #[doc = " display list buffer instead of the FIFO until GX_EndDispList() is called. Writes to the CPU FIFO will be re-enabled when the function"]
    #[doc = " GX_EndDispList() executes."]
    #[doc = ""]
    #[doc = " Basically you can put most of GX API commands into a display list. However, since the use of display list can bypass all state"]
    #[doc = " coherences controlled by GX API in run-time, sometimes it brings some state collisions or incoherences that may lead to unexpected"]
    #[doc = " behavior or even graphics pipeline hang. The most recommended safe way is putting only primitives (regions enclosed by GX_Begin() and"]
    #[doc = " GX_End()) that don't cause any state collisions."]
    #[doc = ""]
    #[doc = " \\note The application is expected to allocate the memory for the display list buffer. If the display list exceeds the maximum size"]
    #[doc = " of the buffer, GX_EndDispList() will return 0. The address of the buffer must be 32-byte aligned; memalign() can return 32-byte-aligned"]
    #[doc = " pointers. You can use the macro ATTRIBUTE_ALIGN(32) to align statically allocated buffers.<br><br>"]
    #[doc = ""]
    #[doc = " \\note The CPU's write-gather pipe is used to write graphics commands to the display list. Therefore, the display list buffer must be"]
    #[doc = " forced out of the CPU cache prior to being filled. DCInvalidateRange() may be used for this purpose. In addition, due to the mechanics"]
    #[doc = " of flushing the write-gather pipe, the display list buffer should be at least 63 bytes larger than the maximum expected amount of data"]
    #[doc = " stored.<br><br>"]
    #[doc = ""]
    #[doc = " \\note A display list cannot be nested; i.e., no display list functions (GX_BeginDispList(), GX_EndDispList() and GX_CallDispList()) can"]
    #[doc = " be called between a GX_BeginDispList() and GX_EndDispList() pair.<br><br>"]
    #[doc = ""]
    #[doc = " \\note To execute a display list, use GX_CallDispList()."]
    #[doc = ""]
    #[doc = " \\param[in] list 32-byte aligned buffer to hold the list"]
    #[doc = " \\param[in] size size of the buffer, multiple of 32"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_BeginDispList(list: *mut ::libc::c_void, size: u32_);
}
extern "C" {
    #[doc = " \\fn void GX_CallDispList(void *list,u32 nbytes)"]
    #[doc = " \\brief Causes the GP to execute graphics commands from the display \\a list instead of from the GP FIFO."]
    #[doc = ""]
    #[doc = " \\details When the number of bytes specified by \\a nbytes have been read, the graphics processor will resume executing"]
    #[doc = " commands from the graphics FIFO. Graphics commands from a display list are prefetched into a separate 4KB FIFO. This prevents"]
    #[doc = " any data prefetched for the main graphics command stream from being lost during the display list call."]
    #[doc = ""]
    #[doc = " \\note A display list cannot call another display list.<br><br>"]
    #[doc = ""]
    #[doc = " \\note The display list must be padded to a length of 32B. All the data in the display list is interpreted by the graphics"]
    #[doc = " processor, so any unused memory at the end of a display list should be set to GX_NOP. If you create the display list using"]
    #[doc = " GX_BeginDispList()/GX_EndDispList(), this padding will be inserted automatically."]
    #[doc = ""]
    #[doc = " \\param[in] list 32-byte aligned pointer to the display list buffer"]
    #[doc = " \\param[in] nbytes number of bytes in the display list. Use the return value of GX_EndDispList() here."]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_CallDispList(list: *mut ::libc::c_void, nbytes: u32_);
}
