extern "C" {
    #[doc = " \\fn void GX_LoadPosMtxImm(Mtx mt,u32 pnidx)"]
    #[doc = " \\brief Used to load a 3x4 modelview matrix \\a mt into matrix memory at location \\a pnidx."]
    #[doc = ""]
    #[doc = " \\details This matrix can be used to transform positions in model space to view space, either by making the matrix the current one (see"]
    #[doc = " GX_SetCurrentMtx()), or by setting a matrix \\a pnidx for each vertex. The parameter \\a mt is a pointer to a 3x4 (row x column) matrix. The"]
    #[doc = " parameter \\a pnidx is used to refer to the matrix location (see \\ref pnmtx) in matrix memory."]
    #[doc = ""]
    #[doc = " You can also load a normal matrix (GX_LoadNrmMtxImm() or GX_LoadNrmMtxIdx3x3()) to the same \\a pnidx. Generally, the normal matrix"]
    #[doc = " will be the inverse transpose of the position matrix. The normal matrix is used during vertex lighting. In cases where the modelview"]
    #[doc = " and inverse transpose of the modelview (excluding translation) are the same, you can load the <i>same</i> matrix for both position and normal"]
    #[doc = " transforms."]
    #[doc = ""]
    #[doc = " \\note The matrix data is copied from DRAM through the CPU cache into the Graphics FIFO, so matrices loaded using this function are always"]
    #[doc = " coherent with the CPU cache."]
    #[doc = ""]
    #[doc = " \\param[in] mt the matrix to load"]
    #[doc = " \\param[in] pnidx \\ref pnmtx to load into"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_LoadPosMtxImm(mt: *mut [f32_; 4usize], pnidx: u32_);
}
extern "C" {
    #[doc = " \\fn void GX_LoadPosMtxIdx(u16 mtxidx,u32 pnidx)"]
    #[doc = " \\brief Loads a 3x4 modelview matrix at index \\a mtxidx from the array in main memory."]
    #[doc = ""]
    #[doc = " \\details The array is set by GX_SetArray(), and the matrix is loaded into matrix memory at index \\a pnidx (see \\ref pnmtx). This"]
    #[doc = " modelview matrix is used to transform positions in model space to view space, either by making the matrix the current one (see"]
    #[doc = " GX_SetCurrentMtx()) or by setting a matrix \\a pnidx for each vertex (see GX_SetVtxDesc()). The matrix will be loaded through the vertex cache."]
    #[doc = ""]
    #[doc = " You can also load a normal matrix (GX_LoadNrmMtxImm() or GX_LoadNrmMtxIdx3x3()) to the same \\a pnidx. Generally, the normal matrix"]
    #[doc = " will be the inverse transpose of the position matrix. The normal matrix is used during vertex lighting. In cases where the modelview"]
    #[doc = " and inverse transpose of the modelview (excluding translation) are the same, you can load the <i>same</i> matrix for both position and normal"]
    #[doc = " transforms. Since indexed matrix loads are through the vertex cache, you will only incur the main memory bandwidth load of one matrix load."]
    #[doc = ""]
    #[doc = " \\note The matrix is loaded directly from main memory into the matrix memory thrugh the vertex cache, so it is incoherent with the CPU's cache."]
    #[doc = " It is the application's responsibility to flush any matrix data from the CPU cache (see DCStoreRange()) before calling this function."]
    #[doc = ""]
    #[doc = " \\param[in] mtxidx index to the matrix array to load"]
    #[doc = " \\param[in] pnidx \\ref pnmtx to load into"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_LoadPosMtxIdx(mtxidx: u16_, pnidx: u32_);
}
extern "C" {
    #[doc = " \\fn void GX_LoadNrmMtxImm(Mtx mt,u32 pnidx)"]
    #[doc = " \\brief Used to load a normal transform matrix into matrix memory at location \\a pnidx from the 4x3 matrix \\a mt."]
    #[doc = ""]
    #[doc = " \\details This matrix is used to transform normals in model space to view space, either by making it the current matrix (see GX_SetCurrentMtx()),"]
    #[doc = " or by setting a matrix pnidx for each vertex. The parameter \\a mt is a pointer to a 3x4 (row x column) matrix. The translation terms"]
    #[doc = " in the 3x4 matrix are not needed for normal rotation and are ignored during the load. The parameter \\a pnidx is used to refer to the"]
    #[doc = " matrix location (see \\ref pnmtx) in matrix memory."]
    #[doc = ""]
    #[doc = " \\note You can also load a position matrix (GX_LoadPosMtxImm()) to the same \\a pnidx. Normally, the normal matrix will be the inverse transpose of"]
    #[doc = " the position (modelview) matrix and is used during vertex lighting. In cases where the modelview and the inverse transpose of the modelview"]
    #[doc = " matrix (excluding translation) are the same, the same matrix can be loaded for both normal and position matrices.<br><br>"]
    #[doc = ""]
    #[doc = " \\note The matrix data is copied from main memory or the CPU cache into the Graphics FIFO, so matrices loaded by this function are always coherent"]
    #[doc = " with the CPU cache.<br><br>"]
    #[doc = ""]
    #[doc = " \\note To load a normal matrix from a 3x3 matrix, use GX_LoadNrmMtxImm3x3()."]
    #[doc = ""]
    #[doc = " \\param[in] mt the matrix to load"]
    #[doc = " \\param[in] pnidx \\ref pnmtx to load into"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_LoadNrmMtxImm(mt: *mut [f32_; 4usize], pnidx: u32_);
}
