extern "C" {
    #[doc = " \\fn void GX_LoadTexMtxImm(Mtx mt,u32 texidx,u8 type)"]
    #[doc = " \\brief Loads a texture matrix \\a mt into the matrix memory at location \\a texidx."]
    #[doc = ""]
    #[doc = " \\details The matrix loaded can be either a 2x4 or 3x4 matrix as indicated by \\a type. You can use the loaded matrix to"]
    #[doc = " transform texture coordinates, or to generate texture coordinates from position or normal vectors. Such generated texture"]
    #[doc = " coordinates are used for projected textures, reflection mapping, etc. See GX_SetTexCoordGen() for more details."]
    #[doc = ""]
    #[doc = " Texture matrices can be either 2x4 or 3x4. <tt>GX_MTX_2x4</tt> matrices can be used for simple translations and/or rotations of texture"]
    #[doc = " coordinates. <tt>GX_MTX_3x4</tt> matrices are used when projection is required."]
    #[doc = ""]
    #[doc = " \\note The default matrix memory configuration allows for ten (3x4 or 2x4) texture matrices, and a 3x4 identity matrix. The <tt>GX_IDENTITY</tt>"]
    #[doc = " matrix is preloaded by GX_Init().<br><br>"]
    #[doc = ""]
    #[doc = " \\note This function allows one to load post-transform texture matrices as well. Specifying a texidx in the range of \\ref dttmtx will load a"]
    #[doc = " post-transform texture matrix instead of a regular, first-pass texture matrix. Note that post-transform matrices are always 3x4. Refer to"]
    #[doc = " GX_SetTexCoordGen2() for information about how to use post-transform texture matrices."]
    #[doc = ""]
    #[doc = " \\param[in] mt the matrix to load"]
    #[doc = " \\param[in] texidx \\ref texmtx"]
    #[doc = " \\param[in] type \\ref mtxtype"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_LoadTexMtxImm(mt: *mut [f32_; 4usize], texidx: u32_, type_: u8_);
}
