extern "C" {
    #[doc = " \\fn void GX_SetBlendMode(u8 type,u8 src_fact,u8 dst_fact,u8 op)"]
    #[doc = " \\brief Determines how the source image, generated by the graphics processor, is blended with the Embedded Frame Buffer (EFB)."]
    #[doc = ""]
    #[doc = " \\details When \\a type is set to <tt>GX_BM_NONE</tt>, the source data is written directly to the EFB. When \\a type is set to <tt>GX_BM_BLEND</tt>, the source color and EFB"]
    #[doc = " pixels are blended using the following equation:"]
    #[doc = ""]
    #[doc = " &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<i>dst_pix_clr</i> = <i>src_pix_clr</i> * \\a src_fact + <i>dst_pix_clr</i> * \\a dst_fact"]
    #[doc = ""]
    #[doc = " The <tt>GX_BL_DSTALPHA</tt> / <tt>GX_BL_INVDSTALPHA</tt> can be used only when the EFB has <tt>GX_PF_RGBA6_Z24</tt> as the pixel format (see GX_SetPixelFmt()). If the pixel"]
    #[doc = " format is <tt>GX_PF_RGBA6_Z24</tt> then the \\a src_fact and \\a dst_fact are also applied to the alpha channel. To write the alpha channel to the EFB you must"]
    #[doc = " call GX_SetAlphaUpdate()."]
    #[doc = ""]
    #[doc = " When type is set to <tt>GX_BM_LOGIC</tt>, the source and EFB pixels are blended using logical bitwise operations. When type is set to <tt>GX_BM_SUBTRACT</tt>, the destination"]
    #[doc = " pixel is computed as follows:"]
    #[doc = ""]
    #[doc = " &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<i>dst_pix_clr</i> = <i>dst_pix_clr</i> - <i>src_pix_clr [clamped to zero]</i>"]
    #[doc = ""]
    #[doc = " Note that \\a src_fact and \\a dst_fact are not part of this equation."]
    #[doc = ""]
    #[doc = " \\note Color updates should be enabled by calling GX_SetColorUpdate()."]
    #[doc = ""]
    #[doc = " \\param[in] type \\ref blendmode"]
    #[doc = " \\param[in] src_fact \\ref blendfactor"]
    #[doc = " \\param[in] dst_fact \\ref blendfactor"]
    #[doc = " \\param[in] op \\ref logicop"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_SetBlendMode(type_: u8_, src_fact: u8_, dst_fact: u8_, op: u8_);
}
