    #[doc = " \\note The reference triangle can be culled using <tt>GX_SetCullMode(GX_CULL_ALL)</tt> to create an invisible reference plane; however, the reference"]
    #[doc = " triangle must not be completely out of view, i.e. trivially rejected by clipping.<br><br>"]
