    #[doc = " point or line. The \\a fmts are added after the texture coordinate generation operation; see GX_SetTexCoordGen(). This function enables this"]
    #[doc = " operation for a particular texture coordinate. Offset operations for points and lines are enabled separately. If the enables are false, the same"]
    #[doc = " texture coordinate is used for every vertex of the line or point."]
