extern "C" {
    #[doc = " \\fn void GX_SetFog(u8 type,f32 startz,f32 endz,f32 nearz,f32 farz,GXColor col)"]
    #[doc = " \\brief Enables fog."]
    #[doc = ""]
    #[doc = " \\details Using \\a type, the programmer may select one of several functions to control the fog density as a function of range to a quad (2x2 pixels)."]
    #[doc = " Range is cosine corrected Z in the x-z plane (eye coordinates), but is not corrected in the y direction (see GX_SetFogRangeAdj()). The parameters \\a startz and"]
    #[doc = " \\a endz allow further control over the fog behavior. The parameters \\a nearz and \\a farz should be set consistent with the projection matrix parameters. Note that these"]
    #[doc = " parameters are defined in eye-space. The fog color, in RGBX format (i.e. the alpha component is ignored), is set using the \\a col parameter. This will be the"]
    #[doc = " color of the pixel when fully fogged."]
    #[doc = ""]
    #[doc = " \\note GX_Init() turns fog off by default."]
    #[doc = ""]
    #[doc = " \\param[in] type \\ref fogtype to use"]
    #[doc = " \\param[in] startz minimum Z value at which the fog function is active"]
    #[doc = " \\param[in] endz maximum Z value at which the fog function is active"]
    #[doc = " \\param[in] nearz near plane (which should match the projection matrix parameters)"]
    #[doc = " \\param[in] farz far plane (which should match the projection matrix parameters)"]
    #[doc = " \\param[in] col fog color; alpha component is ignored"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_SetFog(type_: u8_, startz: f32_, endz: f32_, nearz: f32_, farz: f32_, col: GXColor);
}
extern "C" {
    #[doc = " \\fn void GX_SetFogRangeAdj(u8 enable,u16 center,GXFogAdjTbl *table)"]
    #[doc = " \\brief Enables or disables horizontal fog-range adjustment."]
    #[doc = ""]
    #[doc = " \\details This adjustment is a factor that is multiplied by the eye-space Z used for fog computation; it is based upon the X position of the pixels being"]
    #[doc = " rendered. The Y direction is not compensated. This effectively increases the fog density at the edges of the screen, making for a more realistic fog"]
    #[doc = " effect. The adjustment is computed per quad (2x2 pixels), not per-pixel. The center of the viewport is specified using \\a center. The range adjustment"]
    #[doc = " table is specified using \\a table. The range adjust function is mirrored horizontally about the \\a center."]
    #[doc = ""]
    #[doc = " \\note GX_Init() disables range adjustment."]
    #[doc = ""]
    #[doc = " \\sa GX_InitFogAdjTable()"]
    #[doc = ""]
    #[doc = " \\param[in] enable enables adjustment when <tt>GX_ENABLE</tt> is passed; disabled with <tt>GX_DISABLE</tt>"]
    #[doc = " \\param[in] center centers the range adjust function; normally corresponds with the center of the viewport"]
    #[doc = " \\param[in] table range adjustment parameter table"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_SetFogRangeAdj(enable: u8_, center: u16_, table: *mut GXFogAdjTbl);
}
