extern "C" {
    #[doc = " \\fn void GX_SetIndTexMatrix(u8 indtexmtx,f32 offset_mtx[2][3],s8 scale_exp)"]
    #[doc = " \\brief Sets one of the three static indirect matrices and the associated scale factor."]
    #[doc = ""]
    #[doc = " \\details The indirect matrix and scale is used to process the results of an indirect lookup in order to produce offsets to use during a regular lookup."]
    #[doc = " The matrix is multiplied by the [S T U] offsets that have been extracted (and optionally biased) from the indirect lookup color. In this matrix-vector"]
    #[doc = " multiply, the matrix is on the left and the [S T U] column vector is on the right."]
    #[doc = ""]
    #[doc = " \\note The matrix values are stored in the hardware as a sign and 10 fractional bits (two's complement); thus the smallest number that can be stored is"]
    #[doc = " -1 and the largest is (1 - 1/1024) or approximately 0.999. Since +1 cannot be stored, you may consider dividing all the matrix values by 2 (thus +1"]
    #[doc = " becomes +0.5) and adding one to the scale value in order to compensate."]
    #[doc = ""]
    #[doc = " \\param[in] indtexmtx \\ref indtexmtx that is being affected"]
    #[doc = " \\param[in] offset_mtx values to assign to the indirect matrix"]
    #[doc = " \\param[in] scale_exp exponent to use for the associated scale factor"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_SetIndTexMatrix(indtexmtx: u8_, offset_mtx: *mut [f32_; 3usize], scale_exp: s8);
}
extern "C" {
    #[doc = " \\fn void GX_SetTevIndBumpST(u8 tevstage,u8 indstage,u8 mtx_sel)"]
    #[doc = " \\brief Sets up an environment-mapped bump-mapped indirect lookup."]
    #[doc = ""]
    #[doc = " \\details The indirect map specifies offsets in (S,T) space. This kind of lookup requires 3 TEV stages to compute. As a result of all this work, a simple"]
    #[doc = " 2D bump map is properly oriented to the surface to which it is applied. It is used to alter a normal-based texgen which then looks up an environment map."]
    #[doc = " The environment map may be a simple light map, or else it may be a reflection map of the surrounding scenery."]
    #[doc = ""]
    #[doc = " \\note When using this function, texture lookup should be disabled for the first two TEV stages. The third stage is where the texture lookup is actually performed."]
    #[doc = " The associated geometry must supply normal/binormal/tangent coordinates at each vertex. Appropriate texgens must supply each of these to the proper stages"]
    #[doc = " (binormal to the first, tangent to the second, and normal to the third). Although a static indirect matrix is not used, one must choose a matrix slot and set up"]
    #[doc = " the associated scale value to be used with this lookup."]
    #[doc = ""]
    #[doc = " \\param[in] tevstage \\ref tevstage that is being affected"]
    #[doc = " \\param[in] indstage \\ref indtexstage results to use with this TEV stage"]
    #[doc = " \\param[in] mtx_sel which \\ref indtexmtx to multiply the offsets with"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_SetTevIndBumpST(tevstage: u8_, indstage: u8_, mtx_sel: u8_);
}
extern "C" {
    #[doc = " \\fn void GX_SetTevIndBumpXYZ(u8 tevstage,u8 indstage,u8 mtx_sel)"]
    #[doc = " \\brief Sets up an environment-mapped bump-mapped indirect lookup."]
    #[doc = ""]
    #[doc = " \\details The indirect map specifies offsets in object (X, Y, Z) space. This kind of lookup requires only one TEV stage to compute; however, the bump map (indirect"]
    #[doc = " map) used is geometry-specific. Thus there is a space/computation tradeoff between using this function and using GX_SetTevIndBumpST()."]
    #[doc = ""]
    #[doc = " \\note The indirect matrix must be loaded with a transformation for normals from object space to texture space (similar to eye space, but possibly with an inverted"]
    #[doc = " Y axis). The surface geometry need only provide regular normals at each vertex. A normal-based texgen must be set up for the regular texture coordinate."]
    #[doc = ""]
    #[doc = " \\param[in] tevstage \\ref tevstage that is being affected"]
    #[doc = " \\param[in] indstage \\ref indtexstage results to use with this TEV stage"]
    #[doc = " \\param[in] mtx_sel which \\ref indtexmtx to multiply the offsets with"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_SetTevIndBumpXYZ(tevstage: u8_, indstage: u8_, mtx_sel: u8_);
}
