extern "C" {
    #[doc = " \\fn void GX_SetPixelFmt(u8 pix_fmt,u8 z_fmt)"]
    #[doc = " \\brief Sets the format of pixels in the Embedded Frame Buffer (EFB)."]
    #[doc = ""]
    #[doc = " \\details There are two non-antialiased \\a pix_fmts: <tt>GX_PF_RGB8_Z24</tt> and <tt>GX_PF_RGBA6_Z24</tt>. The stride of the EFB is fixed at 640 pixels. The"]
    #[doc = " non-antialiased EFB has 528 lines available."]
    #[doc = ""]
    #[doc = " When \\a pix_fmt is set to <tt>GX_PF_RGB565_Z16</tt>, multi-sample antialiasing is enabled. In order to get proper results, one must also call GX_SetCopyFilter()."]
    #[doc = " The position of the subsamples and the antialiasing filter coefficients are set using GX_SetCopyFilter(). When antialiasing, three 16b color/Z"]
    #[doc = " samples are computed for each pixel, and the total available number of pixels in the EFB is reduced by half (640 pixels x 264 lines). This function also sets the"]
    #[doc = " compression type for 16-bit Z formats, which allows trading off Z precision for range. The following guidelines apply:<br><br>"]
    #[doc = ""]
    #[doc = " &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;a) far/near ratio <= 2^16, use <tt>GX_ZC_LINEAR</tt><br>"]
    #[doc = " &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;b) far/near ratio <= 2^18, use <tt>GX_ZC_NEAR</tt><br>"]
    #[doc = " &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;c) far/near ratio <= 2^20, use <tt>GX_ZC_MID</tt><br>"]
    #[doc = " &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;d) far/near ratio <= 2^24, use <tt>GX_ZC_FAR</tt><br><br>"]
    #[doc = ""]
    #[doc = " It is always best to use as little compression as possible (choice \"a\" is least compressed, choice \"d\" is most compressed). You get less precision with higher compression."]
    #[doc = " The \"far\" in the above list does not necessarily refer to the far clipping plane. You should think of it as the farthest object you want correct occlusion for."]
    #[doc = ""]
    #[doc = " \\note This function also controls antialiasing (AA) mode.<br><br>"]
    #[doc = ""]
    #[doc = " \\note Since changing pixel format requires the pixel pipeline to be synchronized, the use of this function causes stall of the graphics processor as a result. Therefore,"]
    #[doc = " you should avoid redundant calls of this function."]
    #[doc = ""]
    #[doc = " \\param[in] pix_fmt <tt>GX_PF_RGB8_Z24</tt> or <tt>GX_PF_RGBA6_Z24</tt> for non-AA, <tt>GX_PF_RGB565_Z16</tt> for AA"]
    #[doc = " \\param[in] z_fmt \\ref zfmt to use"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_SetPixelFmt(pix_fmt: u8_, z_fmt: u8_);
}
