extern "C" {
    #[doc = " \\fn void GX_SetTexCoordBias(u8 texcoord,u8 s_enable,u8 t_enable)"]
    #[doc = " \\brief Sets the texture coordinate bias of a particular texture."]
    #[doc = ""]
    #[doc = " \\details Range bias is used with texture coordinates applied in <tt>GX_REPEAT</tt> wrap mode in order to increase the precision of texture coordinates"]
    #[doc = " that spread out over a large range. The texture coordinate values for a primitive are biased (by an equal integer) towards zero early in the"]
    #[doc = " graphics pipeline, thus preserving bits for calculation later in the pipe.  Since the coordinates are repeated, this bias by an integer should"]
    #[doc = " have no effect upon the actual appearance of the texture."]
    #[doc = ""]
    #[doc = " \\note Texture coordinate range bias is something that is normally set automatically by the GX API (during GX_Begin()); however, when a texture"]
    #[doc = " coordinate is being scaled manually (by using GX_SetTexCoordScaleManually()), the associated bias is no longer modified by GX. Thus,"]
    #[doc = " GX_SetTexCoordBias() allows the bias to be changed while a texture coordinate is being manually controlled."]
    #[doc = ""]
    #[doc = " \\param[in] texcoord \\ref texcoordid being changed"]
    #[doc = " \\param[in] s_enable enable or disable range bias in the S direction with <tt>GX_ENABLE</tt>/<tt>GX_DISABLE</tt>"]
    #[doc = " \\param[in] t_enable enable or disable range bias in the T direction with <tt>GX_ENABLE</tt>/<tt>GX_DISABLE</tt>"]
    #[doc = ""]
    #[doc = " \\return none"]
    pub fn GX_SetTexCoordBias(texcoord: u8_, s_enable: u8_, t_enable: u8_);
}
