    #[doc = " \\brief Sets coefficients for distance attenuation in a light object."]
    #[doc = ""]
    #[doc = " \\details This function uses three easy-to-control parameters instead of <i>k0</i>, <i>k1</i>, and <i>k2</i> in GX_InitLightAttn()."]
    #[doc = ""]
    #[doc = " In this function, you can specify the brightness on an assumed reference point. The parameter \\a ref_distance is distance between the light"]
