    #[doc = " be greater than 0 and that for \\a ref_brite should be within 0 < \\a ref_brite < 1, otherwise distance attenuation feature is turned off. The"]
    #[doc = " parameter \\a dist_fn defines type of the brightness decreasing curve by distance; <tt>GX_DA_OFF</tt> turns distance attenuation feature off."]
    #[doc = ""]
